  datosArray(datos){

    // console.log(datos);

    this.arrcon = [];
    if(datos.length > 0){
      for(let j = 0; j < datos.length; j++){
        //var info = datos[j];
        //console.log(info);
        if (datos[j].Docs.length>0){
          this.arrcon.push(datos[j])
        }
      }
       console.log('arrcon',this.arrcon);
      
    }
    this.loading = false;
  }


